import sys
import math
from collections import defaultdict

def candidate_func(input_data):
    lines = input_data.strip().split('\n')
    N, K = map(int, lines[0].split())
    A = list(map(int, lines[1].split()))

    max_val = max(A)
    divisors = defaultdict(list)

    for i in range(N):
        num = A[i]
        for j in range(1, int(num**0.5) + 1):
            if num % j == 0:
                divisors[j].append(i)
                if j != num // j:
                    divisors[num // j].append(i)

    result = [1] * N

    for d in range(max_val, 0, -1):
        if d in divisors and len(divisors[d]) >= K:
            indices = divisors[d]
            for idx in indices:
                if result[idx] < d:
                    result[idx] = d

    return '\n'.join(map(str, result))
